import React, { useState, useEffect } from "react";
import axios from "axios";
import User from "./User.js";
import {
  Container,
  Box,
  Button,
  Grid,
  RadioGroup,
  FormControlLabel,
  FormControl,
  FormLabel,
  Radio,
} from "@material-ui/core";
// import "./styles.css";
import {
  Radar,
  RadarChart,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis,
} from "recharts";

export default function Result(props) {
  const [graphdata, setGraphdata] = useState([]); //전체 데이터
  const [name, setName] = useState([{}]); //이름
  const [gender, setGender] = useState([{}]); //성별
  const [date, setDate] = useState([{}]); //검사일
  const [score, setScore] = useState([]); //결과
  const seq = props.location.state.url.split("=")[1];
  const url = `https://inspct.career.go.kr/inspct/api/psycho/report?seq=${seq}`;
  const [major, setMajor] = useState(null);
  const [edu, setEdu] = useState(null);

  const item = [
    "능력발휘",
    "자율성",
    "보수",
    "안정성",
    "사회적 안정",
    "사회봉사",
    "자기계발",
    "창의성",
  ];

  //top 2개 추출
  // var sortingField = "score";
  // array.sort(function (a, b) {
  //   return b[sortingField] - a[sortingField];
  // });

  //결과 요청
  async function fetchResult() {
    const response = await axios.get(url);

    setName(response.data.user.name);
    setGender(response.data.user.grade);
    setDate(response.data.inspct.beginDtm.slice(0, 10));
    setScore(response.data.result.wonScore.split(" ").split("=")[1]);
  }
  useEffect(() => {
    fetchResult();
  }, []);

  useEffect(() => {
    let scoreArr = [];
    if (
      String(score).match(/=/) != null &&
      String(score).match(/=/).length == 8
    ) {
      score.map((sc, idx) => {
        // array[result_list[idx]] = sc.split("=")[1];
        // array2[idx] = sc.split("=")[1];
        scoreArr += { score: sc.split("=")[1] };
      });
    }
  }, []);
  console.log(score);
  console.log(graphdata);

  const data = [
    {
      subject: "능력발휘",
      A: score[0],
      B: 110,
      fullMark: 150,
    },
    {
      subject: "자율성",
      A: score[1],
      B: 110,
      fullMark: 150,
    },
    {
      subject: "보수",
      A: score[2],
      B: 110,
      fullMark: 150,
    },
    {
      subject: "안정성",
      A: score[3],
      B: 130,
      fullMark: 150,
    },
    {
      subject: "사회적 인정",
      A: score[4],
      B: 130,
      fullMark: 150,
    },
    {
      subject: "사회봉사",
      A: score[5],
      B: 100,
      fullMark: 150,
    },
    {
      subject: "자기계발",
      A: score[6],
      B: 90,
      fullMark: 150,
    },
    {
      subject: "창의성",
      A: score[7],
      B: 85,
      fullMark: 150,
    },
  ];

  const onChangePage = () => {
    props.history.push("/");
  };

  //그래프데이터 수정
  // function makeGraphdata(score) {
  //   let test = JSON.stringify(score).split(" ");
  //   // var array = [{}];

  //   test.map((sc, idx) => {
  //     // array[result_list[idx]] = sc.split("=")[1];
  //     // array2[idx] = sc.split("=")[1];
  //     graphdata[idx] = { name: result_list[idx], score: sc.split("=")[1] };
  //   });
  //   console.log(graphdata);
  //   // console.log(graphdata[0].score);
  // }

  // useEffect(() => {
  //   // if (score != ' ')
  //   makeGraphdata();
  // }, []);

  //학력별 직업 요청
  async function fetchEduInfo() {
    const edu = await axios.get(
      "https://inspct.career.go.kr/inspct/api/psycho/value/jobs?no1=2&no2=4"
    );
    // console.log(edu.data);
  }
  useEffect(() => {
    fetchEduInfo();
  }, []);

  return (
    <Grid container justify="center">
      <h1>직업 가치관 검사 결과표</h1>
      <Grid container justify="center">
        <p>이름:{JSON.stringify(name)}</p>
        <p>성별:{JSON.stringify(gender)}</p>
        <p>날짜:{JSON.stringify(date)}</p>
      </Grid>
      <Grid container justify="center">
        <RadarChart
          cx={300}
          cy={250}
          outerRadius={150}
          width={500}
          height={500}
          data={data}
        >
          <PolarGrid />
          <PolarAngleAxis dataKey="subject" />
          <PolarRadiusAxis />
          <Radar
            name="Mike"
            dataKey="A"
            stroke="#8884d8"
            fill="#8884d8"
            fillOpacity={0.6}
            s
          />
        </RadarChart>
      </Grid>
      <p>가치관과 관련이 높은 직업</p>
      <br /> <br />
      <p>종사자 평균 학력별</p>
      <p>종사자 평균 전공별</p>
      <Grid container justify="center">
        <Button variant="contained" color="primary" onClick={onChangePage}>
          다시 검사하기
        </Button>
      </Grid>
    </Grid>
  );
}
